import React, {Component} from 'react';
import{Row, Col} from "antd"; //整体布局是行列式

class Main extends Component {
    render() {
        return (
            <Row className="main">
                <Col className="left">left</Col>
                <Col className="right">right</Col>
            </Row>
        );
    }
}

export default Main;
